import React from 'react';
import { Card, CardText, CardBody, CardTitle, CardSubtitle, Button } from 'reactstrap';

const ExperienceCard = (props) => {
  return (
    <div>
      <Card>
        <CardBody>
          <CardTitle>{props.ex.title}</CardTitle>
          <CardSubtitle>{props.ex.date}</CardSubtitle>
          <CardSubtitle>{props.ex.location}</CardSubtitle>
          <CardSubtitle>{props.ex.price}</CardSubtitle>
          <CardText>{props.ex.description}</CardText>
          <Button>See more</Button>
        </CardBody>
      </Card>
      <div>
        <div>
          <div>{props.ex.title}</div>
          <div>{props.ex.date}</div>
          <div>{props.ex.location}</div>
          <div>{props.ex.price}</div>
          <div>{props.ex.description}</div>
          <div>See more</div>
        </div>
      </div>
    </div>
  );
};

export default ExperienceCard;
